{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/kennethsetiono/bellabeat-case-study?scriptVersionId=122486801\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"f6663506","metadata":{"papermill":{"duration":0.011829,"end_time":"2023-03-17T16:30:04.034819","exception":false,"start_time":"2023-03-17T16:30:04.02299","status":"completed"},"tags":[]},"source":["\n","# Summary \n","\n","Bellabeat is a high-tech manufacturer that produces health-focused smart products for women. The company provides a range of smart products that collects data related to human health, including activity levels, sleep duration, and stress level. The mission of the company is empower women by providing knowledge on their health and daily habits. \n","\n","The purpose of this case study is to analyze health data collected from smart devices and reveal growth opportunities for the company. In this case, we are focusing on Bellabeat app. \n","\n","The Bellabeat app provides its customers with data regarding their activity level, sleep time, stress level, and daily habits. Using this data, the app would be able to give summary of the customers' daily health and suggest habits to help the customers make healthy decisions. The Bellabeat app is connected to the other Bellabeat's health-focused smart products. \n","\n","\n","# Ask Phase of Data Analysis\n","\n","## Business Task\n","Identify the trends in how consumers use non-Bellabeat smart devices and provide insights to improve Bellabeat’s marketing strategy based on the trends. \n","\n","## Stakeholders\n","\n","* Urška Sršen – Bellabeat’s cofounder and Chief Creative Officer\n","* Sando Mur – Bellabeat’s cofounder and key member of the Bellabeat executive team\n","*\tBellabeat marketing analytics team\n","\n","\n","# Prepare Phase of Data Analysis\n","\n","## Dataset used: \n","The dataset used in this case study is FitBit Fitness Tracker Data. The data source is stored in Kaggle and made publicly available by Mobius.\n","\n","## Accessibility and privacy of the data: \n","Based on the metadata of the dataset, the data set is open-source. The author has dedicated the dataset to the public domain by waiving all of his/her rights to the work worldwide under copyright law, including all related and neighboring rights, to the extent allowed by law. Anyone that has access to the dataset can copy, modify, distribute, and perform all work, including for commercial purposes, without needing to ask for permission.\n","\n","## Dataset information and integrity: \n","The dataset used in this case study is consisted of 18 CSV files, each represents different quantitative data tracked and stored by FitBit. Based on the format, most of the datasets are considered long due to each row having one time point per subject, meaning that each subject has data in multiple rows. Every participant in the study was given a unique ID and different rows because the data is tracked by day and time. Using the Pivot Table function in Excel, the attributes and observations of each table and relations between tables were verified. Sample size was verified to be 30, and time length of analysis was verified as 31 days.\n","\n","Based on the data description and the datasets, a sampling bias may be present in the study due to limited sample size of 30 FitBit users (participants). We cannot be sure that the sample is a good representation of the general population. Another limitation encountered is that the dataset was based on observations made April 12th, 2016 and May 12th, 2016, meaning that the observations made are not current and have a limited survey time of 1 month. \n","\n","\n","# Process Phase of Data Analysis\n","\n","For this case study, R is chosen as the tool for data analysis based on the amount of data available and its capability to create data visualization for sharing the results with the stakeholders. \n","\n","## Installing R packages and opening libraries\n","R packages consist of functions that can be used for data analytics purposes. The R packages used in this case study were: \n","\n","* tidyverse\n","* here\n","* skimr\n","* lubridate\n","* janitor \n","* ggplot2"]},{"cell_type":"code","execution_count":1,"id":"31f81797","metadata":{"execution":{"iopub.execute_input":"2023-03-17T16:30:04.058815Z","iopub.status.busy":"2023-03-17T16:30:04.05635Z","iopub.status.idle":"2023-03-17T16:30:06.021515Z","shell.execute_reply":"2023-03-17T16:30:06.0192Z"},"papermill":{"duration":1.980214,"end_time":"2023-03-17T16:30:06.024842","exception":false,"start_time":"2023-03-17T16:30:04.044628","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.2 ──\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.4.0      \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 1.0.1 \n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.8      \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.10\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.2.1      \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.5.0 \n","\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.1.3      \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.2 \n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","here() starts at /kaggle/working\n","\n","Loading required package: timechange\n","\n","\n","Attaching package: ‘lubridate’\n","\n","\n","The following objects are masked from ‘package: