026838,"end_time":"2023-03-17T16:30:14.705978","exception":false,"start_time":"2023-03-17T16:30:14.67914","status":"completed"},"tags":[]},"source":["Based on the plots above, there is no correlation between daily activity level based on amount of minutes of sleep per day and number of steps taken per day. There is, however, a positive correlation between the amount of daily steps with calories burned. It makes sense since more steps taken per day requires more energy and more calories burned to create energy. \n","\n","## Use of smart devices\n","\n","### Frequency of smart devices usage. \n","After analyzing some trends present between the variables activity, calories burned, and sleep time, the next step was to observe how frequent the users use the smart devices. This part of analysis can give insights to how non-Bellabeat consumers use smart devices and features that may benefits from them, both of which would be beneficial to Bellabeat’s marketing strategy to plan marketing strategy, as outlined in the business task. \n","\n","Firstly, we would be calculating the number of users using their smart devices daily. In this regards, we would be categorizing the users into three different groups: \n","\n","* Low user: users who use their devices between 1-10 days in the 31-day interval. \n","*\tModerate user: users who use their devices between 11-20 days in the 31-day interval.\n","*\tHigh user: users who use their devices between 21-31 days in the 31-day interval.\n","\n","The first step of the analysis was creating a new data frame grouped by id. A new column was created to store the number of days of which the smart devices were used based on the category above."]},{"cell_type":"code","execution_count":21,"id":"1957e7b6","metadata":{"execution":{"iopub.execute_input":"2023-03-17T16:30:14.761618Z","iopub.status.busy":"2023-03-17T16:30:14.759886Z","iopub.status.idle":"2023-03-17T16:30:14.802717Z","shell.execute_reply":"2023-03-17T16:30:14.800743Z"},"papermill":{"d