"When we put into consideration the total users, the days they have used the smart devices and duration of usage, we can see that most of Low Users use their smart devices all day, while both of the High and Moderate Users use their smart devices for more than half a day. \n","\n","\n","# Act Phase of Data Analysis\n","\n","## Conclusion\n","To achieve the business task set at the start of the case study, the appropriate next step is to collect and analyze Bellabeat’s tracking data, and compare them to the result found in this case study. The datasets used in this case study covers a small sample size and may be susceptible to bias since we do not have access to the detailed demographic information of the participants. Adding our own data based on Bellabeat’s products would allow us to find similarities and differences with the data we analyzed in this case study, as well as providing some insights on how to improve Bellabeat’s smart devices compared to the competitors and open growing opportunities to the company as a whole. Since the mission statement of Bellabeat is to empower and inspires women by manufacturing health-focused smart products, the data from Bellabeat’s products should be focused on young and adult women to find trends related to Bellabeat’s company goals. \n","\n","Nevertheless, we can still provide trends found in the FitBit tracking data and provide insights for the Bellabeat’s marketing team. We found some trends that may be of use to help Bellabeat’s online campaign and improve Bellabeat’s application: \n","\n","### In-app notification regarding daily steps. \n","In the analysis above, we categorized the users into 4 categories based on the number of steps they achieved every day in a week. On average, the users walk more than 7,500 steps a day every day except on Sunday. We could encourage the customers to reach a daily steps goal, with the recommended goal of 8,000 steps as recommended by CDC. According to CDC, the more steps you walk in a day would lower your mortality rate. In addition, based on our analysis of the Fitbit data, the number of steps has a positive correlation with the amount of calories burned. We suggest that Bellabeat implements notifications from Bellabeat’s application to notify how far the customers are from the steps goal and encouraging them to push for the goals daily. \n","\n","### In-app notification regarding the sleep time\n","Based on our analysis on the daily sleep duration, we found that the participants do not get the recommended sleep duration of 7-9 hours every day in a week. Similar to the notification we set for daily steps, Bellabeat should add similar daily notification for sleeping duration and schedule. In the Bellabeat app, the customer are able to set up the desired sleeping time and waking up time. We could provide notifications on when the customer should prepare and go to sleep to achieve their sleeping goals. In addition, we could also provide resources to help customers that are having sleeping difficulties. This can include techniques that help people fall asleep, such as breathing exercise, relaxing music, and sleeping techniques. \n","\n","### Point and Reward system\n","While we push notifications to the customers to encourage them to take more steps and follow sleep schedules, some customers may not be as motivated to follow the notifications. A possible solution for this issue is to introduce a point-reward system in the Bellabeat application, where the customers could earn reward based on their step progress and sleeping duration. When we introduce a reward system, the customers may be more incline to follow the notifications because they would be rewarded with prizes. In addition, we could introduce health-related in-app games that the customers can participate in to earn rewards. For example, we could have a game where the objective is for the customers to take 10,000 steps in a day, or maintain a certain activity level for one hour. Both of which would introduce more motivation for the customers to be more active. The rewards may be in form of stars that could be used to redeem discounts for Bellabeat products and services. \n","\n","### Improvements to Bellabeat products\n","Finally, we have identified several improvements for Bellabeat products. In our last analysis on the duration and frequency of users using FitBit smart products, we found that most of the participants use the smart products for more than half a day (60%) daily, with the second largest distribution use the smart products all day (36%). Based on this, we can conclude that people in general wear smart product for most of their day every day. We recommend that the marketing team would promote the Bellabeat products to have the following features: \n","\n","*\tResistant to water\n","*\tStylish/fashionable wearables\n","*\tHave a long-lasting batteries\n","\n","These features focus on daily use of the products and may attract potential customers to purchase Bellabeat’s products. \n"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":18.328874,"end_time":"2023-03-17T16:30:18.322925","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-03-17T16:29:59.994051","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}